import React, { useState } from 'react';
import axios from 'axios';
import { ClipLoader } from "react-spinners";

function Search() {
    const [query, setQuery] = useState('');
    const [rarity, setRarity] = useState('');
    const [results, setResults] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    // Handle the form submission to trigger the search
    const handleSearch = async (event) => {
        event.preventDefault();
        setLoading(true);
        setError(null); // Clear previous errors

        try {
            // Make a request to the Flask API to search for items
            const response = await axios.get('http://localhost:5000/search', {
                params: { query, rarity },
            });
            setResults(response.data); // Update the state with the results
        } catch (error) {
            console.error('There was an error!', error);
            setError('There was an error with your search. Please try again later.');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div>
            <h1>Search for Items</h1>
            <form onSubmit={handleSearch}>
                <div>
                    <input
                        type="text"
                        placeholder="Search for an item by name..."
                        value={query}
                        onChange={(e) => setQuery(e.target.value)}
                    />
                    <input
                        type="text"
                        placeholder="Search by rarity (optional)..."
                        value={rarity}
                        onChange={(e) => setRarity(e.target.value)}
                    />
                    <button type="submit">Search</button>
                </div>
            </form>

            {loading && <ClipLoader size={50} color="#36d7b7" />}

            {error && <p style={{ color: 'red' }}>{error}</p>}

            <h2>Results</h2>
            <table>
                <thead>
                    <tr>
                        <th>Item Name</th>
                        <th>Rarity</th>
                        <th>Chance</th>
                        <th>Source</th>
                        <th>Rotation</th>
                        <th>Stage</th>
                    </tr>
                </thead>
                <tbody>
                    {results.length > 0 ? (
                        results.map((itemObj, index) => {
                            // Check if this object contains a 'results' array
                            if (itemObj.results) {
                                return itemObj.results.map((item) => (
                                    <tr key={item.id || `${item.itemName}-${index}`}>
                                        <td>{item.itemName}</td>
                                        <td>{item.rarity || 'N/A'}</td>
                                        <td>{item.chance}</td>
                                        <td style={{ position: 'relative', minWidth: '240px' }}>
                                            {item.objectiveName || item.source || item.gameMode ? (
                                                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-start', position: 'relative' }}>
                                                    <span style={{ zIndex: 1 }}>
                                                        {item.objectiveName || item.source || `(${item.planet}) ${item.location}: ${item.gameMode}`}
                                                    </span>
                                                    <button
                                                        onClick={() => window.open(`https://warframe.fandom.com/wiki/${item.itemName || item.source}`)}
                                                        style={{
                                                            position: 'absolute',
                                                            top: '50%',
                                                            right: 0,
                                                            transform: 'translateY(-50%)',
                                                            background: 'gray',
                                                            border: 'none',
                                                            opacity: 0.5,
                                                            cursor: 'pointer',
                                                            zIndex: 0,
                                                        }}
                                                    />
                                                </div>
                                            ) : (
                                                item.bountyLevel || item.keyName
                                            )}
                                        </td>
                                        <td>{item.rotation ? `Rotation ${item.rotation}` : '-'}</td>
                                        <td>{item.stage ? `${item.stage}` : '-'}</td>
                                    </tr>
                                ));
                            }
                            // If no 'results' array, render the object as a fallback
                            return (
                                <tr key={index}>
                                    <td colSpan="4">No items found for this entry</td>
                                </tr>
                            );
                        })
                    ) : (
                        <tr>
                            <td colSpan="4">No results found</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
}

export default Search;
